import React from "react";
import { NavbarContainer, Logo } from "../styles/NavbarStyles";
import LogoSteam from "../assets/steamLogo.svg";

function Navbar() {
  return (
    <>
      <NavbarContainer>
        <Logo>Steam</Logo>
      </NavbarContainer>
    </>
  );
}

export default Navbar;
